// Import signature SVG as raw string for browser context
import signatureSvgRaw from '../../assets/seal&signature.svg?raw';

// Robust logo system with multiple fallbacks
const getLogoAsBase64 = async (): Promise<string> => {
  try {
    // Method 1: Try PNG first (most reliable for PDFs)
    const pngBase64 = await getPNGLogoBase64();
    if (pngBase64) {
      // Using PNG logo for PDF
      return pngBase64;
    }
  } catch (error) {
    // PNG logo failed, trying SVG fallback
    console.warn('PNG logo failed, trying SVG fallback:', error);
  }

  try {
    // Method 2: Try SVG fallback
    const svgBase64 = getSVGLogoBase64();
    if (svgBase64) {
      // Using SVG logo for PDF
      return svgBase64;
    }
  } catch (error) {
    // SVG logo failed, trying text fallback
    console.warn('SVG logo failed, trying text fallback:', error);
  }

  // Method 3: Text-based fallback (guaranteed to work)
  // Using text-based logo fallback
  return getTextLogoBase64();
};

// Method 1: PNG Logo (Primary - Most Reliable)
const getPNGLogoBase64 = (): string | null => {
  try {
    // Actual PNG base64 data from letterpadIcon.png
    const pngBase64 = 'data:image/png;base64,';
    return pngBase64;
  } catch (error) {
    return null;
  }
};

// Method 2: SVG Logo (Fallback)
const getSVGLogoBase64 = (): string | null => {
  try {
    // Actual SVG base64 data from letterpadIcon.svg
    const svgBase64 = 'data:image/svg+xml;base64,';
    return svgBase64;
  } catch (error) {
    return null;
  }
};

// Method 3: Text Logo (Final Fallback)
const getTextLogoBase64 = (): string => {
  // Create a simple text-based logo as SVG
  const textSvg = `<?xml version="1.0" encoding="UTF-8"?>
<svg version="1.1" xmlns="http://www.w3.org/2000/svg" width="250" height="60" viewBox="0 0 250 60">
  <rect width="250" height="60" fill="#ffffff" stroke="#5B818D" stroke-width="1" rx="4"/>
  <text x="125" y="25" text-anchor="middle" fill="#5B818D" font-family="Arial, sans-serif" font-size="16" font-weight="bold">ESSAR TRAVELS</text>
  <text x="125" y="45" text-anchor="middle" fill="#5B818D" font-family="Arial, sans-serif" font-size="10">Your Travel Partner</text>
</svg>`;
  
  return 'data:image/svg+xml;base64,' + btoa(textSvg);
};

// Function to get signature as base64
const getSignatureAsBase64 = (): string => {
  try {
    // In browser context, we import the SVG as a raw string
    if (signatureSvgRaw && typeof signatureSvgRaw === 'string') {
      const base64 = btoa(signatureSvgRaw);
      const dataUri = 'data:image/svg+xml;base64,' + base64;
      console.log('Signature loaded successfully, base64 length:', base64.length);
      return dataUri;
    }
    console.warn('Signature SVG raw string is not available');
    return '';
  } catch (error) {
    console.error('Error loading signature for browser:', error);
    return '';
  }
};

