// Track ongoing downloads to prevent multiple simultaneous downloads
const ongoingDownloads = new Set<string>();

export const downloadInvoicePDF = async (invoice: any) => {
  const downloadKey = `invoice_${invoice.id}_${invoice.invoiceNumber}`;
  
  // Prevent multiple simultaneous downloads of the same invoice
  if (ongoingDownloads.has(downloadKey)) {
    // Download already in progress for this invoice, skipping
    return;
  }
  
  ongoingDownloads.add(downloadKey);
  
  try {
    // Starting PDF download for invoice
    
    // Try the modern download method first
    try {
      await downloadInvoicePDFModern(invoice);
    } catch (modernError) {
      // Modern method failed, trying direct method
      await downloadInvoicePDFDirect(invoice);
    }
    
  } catch (error) {
    console.error('Error generating PDF:', error);
    alert(' Failed to generate PDF. Please try again.');
  } finally {
    // Always remove from ongoing downloads
    ongoingDownloads.delete(downloadKey);
  }
};

// Direct PDF download using browser's print-to-PDF functionality
export const downloadInvoicePDFDirect = async (invoice: any) => {
  try {
    // Using direct PDF download method
    const htmlContent = await generateInvoiceHTML(invoice);
    const filename = `Invoice_${invoice.invoiceNumber}`;
    
    // Create a new window with the HTML content
    const printWindow = window.open('', '_blank', 'width=800,height=600,scrollbars=yes,resizable=yes');
    if (!printWindow) {
      throw new Error('Popup blocked. Please allow popups for this site.');
    }
    
    // CSP is disabled globally, no need to add meta tags
    
    // Write the HTML content
    printWindow.document.write(htmlContent);
    printWindow.document.close();
    
    // Wait for the content to load
    await new Promise<void>((resolve) => {
      printWindow.onload = () => {
        // HTML content loaded in print window
        resolve();
      };
    });
    
    // Add a small delay to ensure everything is rendered
    await new Promise(resolve => setTimeout(resolve, 1000));
    
    // Focus the window and trigger print
    printWindow.focus();
    
    // Show user-friendly instructions
    const userConfirmed = confirm(
      ` PDF Download Ready!\n\n` +
      `The invoice will open in a new window.\n` +
      `Please follow these steps:\n\n` +
      `1. Click "Print" button (Ctrl+P)\n` +
      `2. Select "Save as PDF" as destination\n` +
      `3. Choose your download location\n` +
      `4. Click "Save"\n\n` +
      `Click OK to open the print dialog.`
    );
    
    if (userConfirmed) {
      // Trigger print dialog
      printWindow.print();
      
      // Close the window after a delay
      setTimeout(() => {
        if (!printWindow.closed) {
          printWindow.close();
        }
      }, 5000);
    } else {
      // User cancelled, close the window
      printWindow.close();
    }
    
  } catch (error) {
    console.error('Error in direct PDF download:', error);
    throw error;
  }
};

// Modern PDF download using iframe and print
export const downloadInvoicePDFModern = async (invoice: any) => {
  try {
    // Using modern PDF download method
    const htmlContent = await generateInvoiceHTML(invoice);
    const filename = `Invoice_${invoice.invoiceNumber}`;
    
    // Create a hidden iframe
    const iframe = document.createElement('iframe');
    iframe.style.position = 'absolute';
    iframe.style.left = '-9999px';
    iframe.style.top = '-9999px';
    iframe.style.width = '210mm';
    iframe.style.height = '297mm';
    iframe.style.border = 'none';
    
    document.body.appendChild(iframe);
    
    // CSP is disabled globally, no need to add meta tags
    
    // Load the HTML content
    iframe.contentDocument?.write(htmlContent);
    iframe.contentDocument?.close();
    
    // Wait for content to load
    await new Promise<void>((resolve) => {
      iframe.onload = () => {
        // HTML content loaded in iframe
        resolve();
      };
    });
    
    // Add a small delay to ensure everything is rendered
    await new Promise(resolve => setTimeout(resolve, 1000));
    
    // Show user-friendly instructions
    const userConfirmed = confirm(
      ` PDF Download Ready!\n\n` +
      `Click OK to open the print dialog.\n` +
      `Then select "Save as PDF" as destination.`
    );
    
    if (userConfirmed && iframe.contentWindow) {
      // Focus and print
      iframe.contentWindow.focus();
      iframe.contentWindow.print();
      
      // Clean up after a delay
      setTimeout(() => {
        document.body.removeChild(iframe);
      }, 3000);
    } else {
      // User cancelled, clean up
      document.body.removeChild(iframe);
    }
    
  } catch (error) {
    console.error('Error in modern PDF download:', error);
    throw error;
  }
};

